import android.view.MenuItem;
import android.view.View;
import android.widget.TextView;
import android.widget.Toast;

import java.util.ArrayList;

public class listActivity extends AppCompatActivity implements IListInterface.view {

    private static final String TAG = "/views/ListActivity";
    private IListInterface.Presenter presenter;
    private ArrayList<EntityFish> items = new ArrayList<>();
    private FishAdapter adapter;
    private boolean flag = false;
    private RecyclerView recyclerView;
    private TextView result;
    private String fish,date,sex;


    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_list);
        presenter = new ListPresenter(this);
        Toolbar toolbar = findViewById(R.id.toolbar);
        setSupportActionBar(toolbar);
        getSupportActionBar().setTitle(R.string.listTitle);
        recyclerView= (RecyclerView) findViewById(R.id.recyclerView);

        FloatingActionButton fab = findViewById(R.id.fab);
        fab.setOnClickListener(view -> {
            presenter.onClickAddFish();

        });

        SharedPreferences preferences = PreferenceManager.getDefaultSharedPreferences(listActivity.this);
        SharedPreferences.Editor myEditor = preferences.edit();

        items = presenter.getAllItemsSummarize();

        if(items.size() == 0 && !flag){
            myEditor.putBoolean("First", true);
            myEditor.apply();
            flag=true;
        }

        boolean firstTime = preferences.getBoolean("First",false);


        //--------LISTA QUE SE VE EN LA APP----------
        if(firstTime){

        EntityFish fish1 = new EntityFish();
        fish1.setId("1");
        fish1.setFish("Barbo");
        fish1.setFisher("Andrea");
        fish1.setImage("");
        presenter.insert(fish1);

        EntityFish fish2 = new EntityFish();
        fish2.setId("2");
        fish2.setFish("Carpa");
        fish2.setFisher("Alvaro");
        fish2.setImage("");
            presenter.insert(fish2);

        EntityFish fish3 = new EntityFish();
        fish3.setId("3");
        fish3.setFish("Black Bass");
        fish3.setFisher("Luque");
        fish3.setImage("");
            presenter.insert(fish3);

        EntityFish fish4 = new EntityFish();
        fish4.setId("4");
        fish4.setFish("Black Bass");
        fish4.setFisher("Pepe");
            presenter.insert(fish4);

        EntityFish fish5 = new EntityFish();
        fish5.setId("5");
        fish5.setFish("Siluro");
        fish5.setFisher("Belen");
            presenter.insert(fish5);

        EntityFish fish6 = new EntityFish();
        fish6.setId("6");
        fish6.setFish("Barbo");
        fish6.setFisher("Carolina");
        fish6.setImage("");
            presenter.insert(fish6);

        EntityFish fish7 = new EntityFish();
        fish7.setId("7");
        fish7.setFish("Black Bass");
        fish7.setFisher("Ana");
        fish7.setImage("");
            presenter.insert(fish7);

        EntityFish fish8 = new EntityFish();
        fish8.setId("8");
        fish8.setFish("Carpa");
        fish8.setFisher("Antonio");
        fish8.setImage("");
            presenter.insert(fish8);

        EntityFish fish9 = new EntityFish();
        fish9.setId("9");
        fish9.setFish("Trucha");
        fish9.setFisher("Mario");
            presenter.insert(fish9);

        EntityFish fish10 = new EntityFish();
        fish10.setId("10");
        fish10.setFish("Black Bass");
        fish10.setFisher("Conchi");
            presenter.insert(fish10);

            myEditor.putBoolean("First",false);
            myEditor.apply();

        }else{
            Log.d(TAG,"The BBDD exist, dates dont charge");
        }


        //--------SWIPE PARA BORRAR-------------

        ItemTouchHelper.SimpleCallback simpleCallback = new ItemTouchHelper.SimpleCallback(0, ItemTouchHelper.RIGHT) {
            @Override
            public boolean onMove(@NonNull RecyclerView recyclerView, @NonNull RecyclerView.ViewHolder viewHolder, @NonNull RecyclerView.ViewHolder target) {
                return false;
            }

            @Override
            public void onSwiped(@NonNull final RecyclerView.ViewHolder viewHolder, int direction) {
                final int position = viewHolder.getAdapterPosition();
                switch (direction) {
                    case ItemTouchHelper.RIGHT:
                        presenter.onSwipe(position);
                        presenter.onToast();
                        break;
                }

            }

        };
        ItemTouchHelper itemTouchHelper = new ItemTouchHelper(simpleCallback);
        itemTouchHelper.attachToRecyclerView(recyclerView);

    }


    //------CREA LAS OPCIONES DEL MENÚ-----------


    @Override
    public boolean onCreateOptionsMenu(Menu menu) {
        MenuInflater inflater = getMenuInflater();
        inflater.inflate(R.menu.main_menu, menu);
        return true;
    }


    //---------OPCIONES SELECCIONADAS (BUSCAR Y SOBRE NOSOTROS)---------

    @Override
    public boolean onOptionsItemSelected(@NonNull MenuItem item) {
        switch (item.getItemId()){
            case R.id.button_search:
                presenter.onClickSearch();
                break;
            case R.id.aboutus:
                presenter.onClickAboutUs();
                break;

        }
        return super.onOptionsItemSelected(item);
    }

    @Override
    protected void onStart() {
        Log.d(TAG, "Starting onStart");
        super.onStart();
    }

    @Override
    protected void onResume() {
        Log.d(TAG, "Starting onResume");
        super.onResume();

        if (sex != null && date == null && fish == null) {
            items.clear();
            items = presenter.getItemsByCriterion("sex", sex);
        } else if (date != null && sex == null && fish == null) {
            items.clear();
            items = presenter.getItemsByCriterion("date", date);
        } else if (fish != null && sex == null && date == null) {
            items.clear();
            items = presenter.getItemsByCriterion("title", fish);
        } else if (fish != null && sex != null && date != null) {
            items.clear();
            items = presenter.getItemsByAllCriterion(sex, date, fish);
        } else if (date == null && fish == null && sex == null) {
            items = presenter.getAllItemsSummarize();
        }




        adapter= new FishAdapter(items);

        recyclerView.setAdapter(adapter);

        recyclerView.setLayoutManager(new LinearLayoutManager(this));

        adapter.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                // Acción al pulsar el elemento
                int position = recyclerView.getChildAdapterPosition(v);
                // Toast.makeText(listActivity.this, "Posición: " + String.valueOf(position) + " Pez: " + items.get(position).getFish() + " Pescador: " + items.get(position).getFisher(), Toast.LENGTH_SHORT)
                //.show();
                presenter.onClickRecyclerViewItem(items.get(position).getId());
            }
        });

        result= findViewById(R.id.text_result);
        result.setText(adapter.getItemCount() + getString(R.string.results));




    }

    @Override
    protected void onPause() {
        Log.d(TAG, "Starting onPause");
        super.onPause();
    }

    @Override
    protected void onStop() {
        Log.d(TAG, "Starting onStop");
        super.onStop();
    }

    @Override
    protected void onRestart() {
        Log.d(TAG, "Starting onRestart");
        super.onRestart();
    }

    @Override
    protected void onDestroy() {
        Log.d(TAG, "Starting onDestroy");
        super.onDestroy();
    }

    @Override
    public void startFormActivity() {
        Log.d(TAG, "Inside startFormActivity");
        Intent intent = new Intent(getApplicationContext(), FormActivity.class);
        startActivity(intent);
    }


    public void startSearchActivity(){
        Log.d(TAG, "Inside startSearchActivity");
        Intent intent = new Intent(getApplicationContext(), searchActivity.class);
        startActivity(intent);
    }

    @Override
    public void startAboutUsActivity() {
        Log.d(TAG, "Inside startAboutUsActivity");
        Intent intent = new Intent(getApplicationContext(), aboutCrud.class);
        startActivity(intent);
    }

    @Override
    public void startFormActivity(String id) {
        Log.d(TAG, "Inside startAboutUsActivity with id");
        Intent intent = new Intent(getApplicationContext(), FormActivity.class);
        intent.putExtra("id",id);
        startActivity(intent);
    }

    @Override
    public void startSwipe(int position) {
        EntityFish fish = items.get(position);
        if(presenter.deleteFish(fish)){
            Log.d(TAG, "Item removed");
        }else{
            Log.d(TAG, "Item not removed");
        }
        adapter.notifyItemRemoved(position);
    }

    //--------MENSAJE DE TOAST--------------

    @Override
    public void startDeleteToast() {
        Toast.makeText(MyApplication.getContext(),"Borrado con éxito",Toast.LENGTH_SHORT).show();
    }


    @Override
    protected void onActivityResult(int requestCode, int resultCode, @Nullable Intent data) {
        super.onActivityResult(requestCode, resultCode, data);
        if(requestCode==1){
            if(resultCode == 1){
                fish = data.getStringExtra("fish");
                sex = data.getStringExtra("sex");
                date = data.getStringExtra("date");
            }
        }
    }
}